import { Link } from "react-router-dom";
import "./css/Main.css";

function Main() {
    return (
        <div className="main-container">
            {/* 배경 이미지 */}
            <div className="main-banner">
                <img src="/images/main_logo.png" alt="배경 이미지" className="background-image" />
            </div>

            {/* 실내 / 실외 상태 버튼 */}
            <div className="status-buttons">
                <button className="status-button active">실내 상황</button>
                <button className="status-button">실외 상황</button>
            </div>

            {/* 실내 정보 및 로그인 */}
            <div className="info-section">
                <div className="indoor-info">
                    <img src="/images/indoor_icon.png" alt="실내 아이콘" className="icon" />
                    <p>현재 실내 온도 : 23도</p>
                    <p>현재 실내 습도 : 43%</p>
                    <p>현재 실내 미세먼지 : 24ug</p>
                </div>

                <div className="login-section">
                    <p>로그인을 해주세요</p>
                    <button className="login-button">로그인 하기</button>
                </div>
            </div>
        </div>
    );
}

export default Main;
